        <Sidebar initialMenuItems={[
            'Albert Eggstein',
            'Attila the Hen',
            'Dixie Chick',
            'Gregory Peck',
            'Mary Poopins'
          ]}></Sidebar>
      </header>
    </div>
  );
}

export default App;
